import React, { Fragment } from "react";
import { Card, Icon, Avatar, Row, Col } from "antd";

const { Meta } = Card;

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(card => (
          <Col span={4}>
            <Card
              style={{ margin: "q0px" }}
              key={card.id}
              title={card.table_number}
              cover={<img alt="" src={card.img} />}
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
